x0jQ","isOwnerViewing":false,"shortDescription":"Os algoritmos de Machine Learning e os modelos de segurana esto viabilizando nveis mais elevados de autonomia em Sistemas Ciberfsicos (CPS) modernos. Garantir uma operao autnoma segura requer a estrita observncia das restries de tempo e segurana, melhor expressas em termos dos dados consumidos, em vez das tarefas executadas. Esta palestra apresenta um design Data-Centric para Sistemas Orientados a Dados, utilizando o conceito de SmartData, uma construo de dados enriquecida com metadados para encapsular origem, semntica e relacionamentos. O SmartData interage por meio de relaes de Interesse, herdando requisitos como frescura, periodicidade e segurana. Atravs deste design, uma clara relao com lgicas temporais surge, permitindo a derivao de propriedades do sistema de forma automatizada e permitindo a verificao em tempo de execuo.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CID0p8YG-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBt9gJdpKnbf8ju6RptXduDcAZmgg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CID0p8YG-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDwBRexGv_VXckuowPYWPioIXkQvw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CID0p8YG-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDHajoUKGZ1_PxEpIuU1Umksl4G_w","width":246,"height":138},{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CID0p8YG-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCGuwabDCVcLUjmT3IsEYW1-oCl2A","width":336,"height":188}]},"allowRatings":true,"viewCount":"88","author":"Forum da Ps-Graduao em Computao do Paran","isLowLatencyLiveStream":true,"isPrivate":false,"isUnpluggedCorpus":false,"latencyClass":"MDE_STREAM_OPTIMIZATIONS_RENDERER_LAT
